function filterDuplicates(array) {
  const tempArr = []
  const uniqueRes = []
  array.map((item) => {
    if (!tempArr.find(tempItem => tempItem == item.id)) {
      tempArr.push(item.id)
      uniqueRes.push(item)
    }
  })
  
  return uniqueRes
}


export default filterDuplicates
